INSERT INTO `pageType_fields` VALUES (1,22,'','The title of the page. This field is used as\n - HTML title of the page\n - Menu name in the header'),(1,106,NULL,'A short description of the research project. This field will be used as `meta:description` in the HTML header. Some services use this tag to provide the user with information on the webpage (e.g. automatic link-replacement in messaging tools on smartphones use this description.)'),(1,174,'','The icon which will be used for menus. For mobile icons use prefix `mobile-`'),(2,22,'','The title of the page. This field is used as\n - HTML title of the page\n - Menu name in the header'),(2,106,NULL,'A short description of the research project. This field will be used as `meta:description` in the HTML header. Some services use this tag to provide the user with information on the webpage (e.g. automatic link-replacement in messaging tools on smartphones use this description.)'),(2,174,'','The icon which will be used for menus. For mobile icons use prefix `mobile-`'),(3,22,'','The title of the page. This field is used as\n - HTML title of the page\n - Menu name in the header'),(3,106,NULL,'A short description of the research project. This field will be used as `meta:description` in the HTML header. Some services use this tag to provide the user with information on the webpage (e.g. automatic link-replacement in messaging tools on smartphones use this description.)'),(3,174,'','The icon which will be used for menus. For mobile icons use prefix `mobile-`'),(5,22,NULL,'Page title'),(5,115,NULL,'This field defines the content of the alert message that is shown when a date is set in the field `maintenance_date`. Use markdown with the special keywords `@date` and `@time` which will be replaced by a human-readable form of the fields `maintenance_date` and `maintenance_time`.'),(5,116,NULL,'If set (together with the field `maintenance_time`), an alert message is shown at the top of the page displaying to content as defined in the field `maintenance` (where the key `@data` is replaced by this field).'),(5,117,NULL,'If set (together with the field `maintenance_date`), an alert message is shown at the top of the page displaying to content as defined in the field `maintenance` (where the key `@time` is replaced by this field).'),(6,22,NULL,'Page title'),(6,185,NULL,'JSON object where can be defined global translation keys and use the key to load the proper translation based on the selected language. A key is accessed by {{key_name}}, and this will be replaced with the value for the selected language'),(7,22,NULL,'Page title'),(7,92,NULL,'Activation email text'),(7,94,NULL,'Reminder email text'),(7,151,NULL,'Email subject text'),(7,183,NULL,'Email activate subject text'),(7,184,NULL,'Email reminder subject text'),(7,196,NULL,'Set the email address which will be used to send activation emails.'),(7,197,NULL,'Set the email address which will be used to send confirmation emails when the users delete their profile'),(7,198,NULL,'Subject text for the email confirmation which is sent when a user profile is deleted'),(7,199,NULL,'Email text which is sent when a user profile is deleted'),(7,200,NULL,'Set an email address that will be notified that a user acount was deleted'),(7,231,NULL,'Subject text for the email which is sent when a user tries to login with 2fa enabled'),(7,232,NULL,'Body text for the email which is sent when a user tries to login with 2fa enabled. `{{2fa_code}}` is used as a keyword where the code will be replaced in the email text.'),(8,22,NULL,'Page title'),(8,193,NULL,'Custom CSS raw code'),(9,22,NULL,'Page title'),(9,202,NULL,'If selected, the user can reset the password with the answers of his/her security questions. All 3 security questions` answers should match in order to reset the password.'),(9,203,NULL,'Security question 1 description'),(9,204,NULL,'Security question 2 description'),(9,205,NULL,'Security question 3 description'),(9,206,NULL,'Security question 4 descrip