INSERT INTO `styleGroup` VALUES (1,'intern','Reserved for internal system styles. Modifying or using these styles externally may cause unexpected behavior.',0),(2,'Form','A form is a wrapper for input fields. It allows to send content of the input fields to the server and store the data to the database. Several style are available:',60),(3,'Input','An input field must be placed inside a form wrapper. An input field allows a user to enter data and submit these to the server. The chosen form wrapper decides what happens with the submitted data. The following input fields styles are available:',70),(4,'Wrapper','A wrapper is a style that allows to group child elements. Wrappers can have a visual component or can be invisible. Visible wrapper are useful to provide some structure in a document while invisible wrappers serve merely as a grouping option . The latter can be useful in combination with CSS classes. The following wrappers are available:',10),(5,'Text','Text styles allow to control how text is displayed. These styles are used to create the main content. The following styles are available:',20),(6,'List','Lists are styles that allow to define more sophisticated lists than the markdown syntax allows. They come with attached javascript functionality. The following lists are available:',50),(7,'Media','The media styles allow to display different media on a webpage. The following styles are available:',40),(8,'Link','Link styles allow to render different types of links:',30),(9,'Admin','The admin styles are for user registration and access handling.\r\nThe following styles are available:',80),(12,'Triggers','Trigger styles allow to attach an action that can be executed when the user fulfill the triger condition',75),(13,'Mobile','Styles that are only used by the mobile application',79);
/*!40000 ALTER TABLE `styleGroup` ENABLE KEYS */;
