INSERT INTO `styles` VALUES (1,'login',93,9,'provides a small form where the user can enter his or her email and password to access the WebApp. It also includes a link to reset a password.',0),(2,'profile',93,1,'',1),(3,'container',92,4,'is an **invisible** wrapper.',1),(4,'jumbotron',92,4,'is a **visible** wrapper that wraps its content in a grey box with large spacing.',1),(5,'heading',92,5,'is used to display the 6 levels of HTML headings.',0),(6,'markdown',93,5,'is the bread-and-butter style which allows to style content in a very flexible way. In addition to markdown syntax, pure HTML statements are allowed which makes this style very versatile. It is recommended to limit the usage of HTML to a minimum in order to keep the layout of the webpage consistent.',0),(7,'markdownInline',92,5,'is similar to the markdown style but is intended for one-line text where emphasis is required.',0),(8,'button',92,8,'renders a button-style link with several predefined colour schemes.',0),(9,'validate',93,1,'',1),(10,'chat',93,1,'',0),(11,'alert',92,4,'is a **visible** wrapper that draws a solid, coloured box around its content. The text colour of the content is changed according to the type of alert.',1),(12,'card',92,4,'is a versatile **visible** wrapper that draws a fine border around its content. A card can also have a title and can be made collapsible.',1),(13,'figure',92,7,'allows to attach a caption to media elements. A figure expects a media style as its immediate child.',1),(14,'form',92,2,'provides only the client-side functionality and does not do anything with the submitted data. This is intended to be connected with a custom component (required PHP programming).',1),(15,'image',92,7,'allows to render an image on a page.',0),(16,'input',93,3,'is a one-line input field style that allows to enter different types of data (e.g. text, color, time, date, checkbox).',0),(17,'plaintext',92,5,'renders simple text. No special syntax is allowed here.',0),(18,'link',92,8,'renders a standard link but allows to open the target in a new tab.',1),(19,'progressBar',92,7,'allows to render a static progress bar.',0),(20,'quiz',92,1,'is a predefined assembly of tabs, intended to ask a question and provide a right and wrong answer tab.',0),(21,'rawText',92,5,'renders text in a mono-space font which makes it useful to display code.',0),(22,'select',93,3,'is a input field style that provides a predefined set of choices which can be selected with a dropdown menu. In contrast to the radio style the select style has a different visual appearance and provides a list of options where also multiple options can be chosen.',0),(23,'slider',93,3,'is an extension of the style input of type range. It allows to provide a label for each position of the slider.',0),(24,'tab',92,4,'is a child element of the style `tabs`.',1),(25,'tabs',92,4,'is a **visible** wrapper that allows to group content into tabs and only show one tab at a time. It requires `tab` styles as its immediate children. Each `tab` then accepts children which represent the content of each tab.',1),(26,'textarea',93,3,'is a multi-line input field style that allows to enter multiple lines of text.',0),(27,'video',92,7,'allows to load and display a video on a page.',0),(28,'accordionList',93,6,'is a **hierarchical** list where the root level is rendered as an accordion with only one root item expanded at a time.',0),(30,'navigationContainer',92,4,'is an **invisible** wrapper and is used specifically for navigation pages.',1),(31,'navigationAccordion',94,1,'',0),(32,'nestedList',93,6,'is a **hierarchical** list where each root item item can be collapsed and expanded by clicking on a chevron.',0),(33,'navigationNested',94,1,'',0),(34,'sortableList',92,6,'is **non-hierarchical** but can be sorted, new items can be added as well as items can be deleted. Note that only the visual aspects of these functions are rendered. The implementation of the functions need to be defined separately with javascript (See <a href=\"https://github.com/RubaXa/Sortable\" target=\"_blank\">Sortable</a> for more details).',0),(35,'resetPassword',93,1,'',0),(36,'formUserInput',93,1,'stores the data from all child input fields into the database and displays the latest set of data in the database as values in the child input field (if `is_log` is unchecked).',1),(38,'radio',93,3,'allows to predefine a set of options for the user to select. It provides a list of options where only one option can be chosen.',0),(39,'showUserInput',93,2,'allows to display user input data. Use the name of a form to display the corresponding data.',0),(40,'div',92,4,'allows to wrap its children in a simple HTML `<div>` tag. This allows to create more complex layouts with the help of bootstrap classes.',1),(41,'register',93,9,'provides a small form to allow a user to register for the WebApp. In order to register a user must provide a valid email and activation code. Activation codes can be generated in the admin section of the WebApp. The list of available codes can be exported.',0),(42,'conditionalContainer',93,4,'is an **invisible** wrapper which has a condition attached. The content of the wrapper is only displayed if the condition resolves to true.',1),(43,'audio',92,7,'allows to load and replay an audio source on a page.',0),(44,'carousel',92,7,'allows to render multiple images as a slide-show.',0),(45,'json',93,4,'allows to describe styles with `json` Syntax',0),(46,'userProgress',93,9,'A progress bar to indicate the overall experiment progress of a user.',0),(49,'autocomplete',92,1,'Provides a text input field which executes an AJAX request on typing.\r\nA AJAX request class and method must be defined for this to work.',0),(57,'navigationBar',92,1,'Provides a navigation bar style',0),(60,'version',93,9,'Add information about the DB version and for the git version of Selfhelp',0),(61,'trigger',93,1,'Create a basic trigger that execute selected action.',0),(63,'entryList',93,4,'Wrap other styles that later visualize list of entries (inserted via `formUserInput`).',1),(64,'entryRecord',93,4,'Wrap other styles that later visualize a record from the entry list',1),(67,'refContainer',92,4,'Wrap other styles that later can be used in different place. It can be used for creating resusable blocks.',1),(68,'formUserInputLog',93,2,' stores the data from all child input fields into the database. All data is entered as a log',1),(69,'formUserInputRecord',93,2,' stores the data from all child input fields into the database. All data is entered as as a single row and it can be edited',1),(70,'conditionFailed',92,1,'**This style should be used as a child in `conditionalContainer`.** Wrap other styles and later show them if the condtion is not met in a condtional container.',1),(71,'conditionBuilder',92,1,'Internal style used for the condition field',0),(72,'dataConfigBuilder',92,1,'Internal style used for the `data-config` field',0),(73,'actionConfigBuilder',92,1,'Internal style used for the configuration of an action',0),(74,'table',92,4,'A style which represent a table. Its children should be `tableRows`',1),(75,'loop',93,4,'A style which takes an array object and loop the rows and load its children passing the values of the rows',1),(76,'tableRow',92,4,'A style which represent a table row. Its children should be `tableCells`',1),(77,'tableCell',92,4,'A style which represent a table cell.',1),(78,'checkbox',93,13,'Exacute shortcut commands in the mobile app that can open native windows. The functinality is based on [capacitor-native-settings](https://github.com/RaphaelWoude/capacitor-native-settings)',0),(79,'dataContainer',93,4,'Data container style which propagate all loaded data to its children.',1),(80,'htmlTag',92,4,'Tag wrapper style used to wrap other styles between the selected tag.',1),(81,'entryRecordDelete',93,4,'Style that allows the user to delete entry record',0),(82,'twoFactorAuth',93,9,'Provides a form for two-factor authentication where users can enter their verification code.',0);
/*!40000 ALTER TABLE `styles` ENABLE KEYS */;
UNLOCK TABLES;

