INSERT INTO `styles_fields` VALUES (1,1,NULL,'The placeholder in the email input field.',0,0),(1,2,NULL,'The placeholder in the password input field.',0,0),(1,3,NULL,'The text on the login button.',0,0),(1,4,NULL,'The name of the password reset link.',0,0),(1,5,NULL,'This text is displayed in a danger-alert-box whenever the login fails.',0,0),(1,7,NULL,'The text displayed in the login card header.',0,0),(1,23,NULL,'Allows to assign CSS classes to the root item of the style.',0,0),(1,28,'dark','This allows to choose the colour scheme for the login form.',0,0),(1,91,NULL,'The field `condition` allows to specify a condition. Note that the field `condition` is of type `json` and requires\n1. valid json syntax (see https://www.json.org/)\n2. a valid condition structure (see https://github.com/jwadhams/json-logic-php/)\n\nOnly if a condition resolves to true the sections added to the field `children` will be rendered.\n\nIn order to refer to a form-field use the syntax `\"@__form_name__#__from_field_name__\"` (the quotes are necessary to make it valid json syntax) where `__form_name__` is the value of the field `name` of the style `formUserInput` and `__form_field_name__` is the value of the field `name` of any form-field style.',0,0),(1,97,NULL,'If *checked*, debug messages will be rendered to the screen. These might help to understand the result of a condition evaluation. **Make sure that this field is *unchecked* once the page is productive**.',0,0),(1,145,NULL,'In this ***JSON*** field we can configure a data retrieve params from the DB, either `static` or `dynamic` data. Example: \n  ```\n  [\n 	{\n 		\"type\": \"static|dynamic\",\n 		\"table\": \"table_name | #url_param1\",\n		\"retrieve\": \"first | last | all\",\n 		\"fields\": [\n 			{\n 				\"field_name\": \"name | #url_param2\",\n 				\"field_holder\": \"@field_1\",\n 				\"not_found_text\": \"my field was not found\"				\n 			}\n 		]\n 	}\n ]\n ```\n If the page supports parameters, then the parameter can be accessed with `#` and the name of the paramer. Example `#url_param_name`. \n \n In order to inlcude the retrieved data in the markdown field, include the `field_holder` that wa defined in the markdown text.\n \n We can access multiple tables by adding another element to the array. The retrieve data from the column can be: `first` entry, `last` entry or `all` entries (concatenated with ;)',0,0),(1,182,NULL,'Allows to assign `mobile` CSS classes to the root item of the style.',0,0),(2,5,NULL,'This text will be displayed if a user was unable to change his settings.',0,0),(2,6,NULL,'This field holds the main structure of the profile page content. Styles were used to construct this in order to keep the layout consistent. In order to change specific aspects of the profile page, navigate through the children and make changes where needed.',0,0),(2,19,NULL,'This text will be displayed if a user wants to delete his or her account but the operation failed.',0,0),(2,20,NULL,'This text will be displayed upon successful deletion of a user account.',0,0),(2,35,NULL,'This text will be displayed upon successful change of user settings.',0,0),(3,6,NULL,'The child sections to be added to the `container` body. This can hold any style.',0,0),(3,23,NULL,'Allows to assign CSS classes to the root item of the style.',0,0),(3,29,'0','Select for a full width container, spanning the entire width of the viewport.',0,0),(3,91,NULL,'The field `condition` allows to specify a condition. Note that the field `condition` is of type `json` and requires\n1. valid json syntax (see https://www.json.org/)\n2. a valid condition structure (see https://github.com/jwadhams/json-logic-php/)\n\nOnly if a condition resolves to true the sections added to the field `children` will be rendered.\n\nIn order to refer to a form-field use the syntax `\"@__form_name__#__from_field_name__\"` (the quotes are necessary to make it valid json syntax) where `__form_name__` is the value of the field `name` of the style `formUserInput` and `__form_field_name__` is the value of the field `name` of any form-field style.',0,0),(3,97,NULL,'If *checked*, debug messages will be rendered to the screen. These might help to understand the result of a condition evaluation. **Make sure that this field is *unchecked* once the page is productive**.',0,0),(3,145,NULL,'In this ***JSON*** field we can configure a data retrieve params from the DB, either `static` or `dynamic` data. Example: \n  ```\n  [\n 	{\n 		\"type\": \"static|dynamic\",\n 		\"table\": \"table_name | #url_param1\",\n		\"retrieve\": \"first | last | all\",\n 		\"fields\": [\n 			{\n 				\"field_name\": \"name | #url_param2\",\n 				\"field_holder\": \"@field_1\",\n 				\"not_found_text\": \"my field was not found\"				\n 			}\n 		]\n 	}\n ]\n ```\n If the page supports parameters, then the parameter can be accessed with `#` and the name of the paramer. Example `#url_param_name`. \n \n In order to inlcude the retrieved data in the markdown field, include the `field_holder` that wa defined in the markdown text.\n \n We can access multiple tables by adding another element to the array. The retrieve data from the column can be: `first` entry, `last` entry or `all` entries (concatenated with ;)',0,0),(3,146,'0','If `export_pdf` is checked, the container has an export button in the top righ corner. All children in the container can be exported to a PDF file.\n\nadd class `skipPDF` to the `css` field in an element which should not be exported inthe PDF file\n\nadd class `pdfStartNewPage` to the `css` field in an element which should be on a new page\n\nadd class `pdfStartNewPageAfter` to the `css` field in an element which should insert a new page after it is loaded on the page\n',0,0),(3,182,NULL,'Allows to assign `mobile` CSS classes to the root item of the style.',0,0),(4,6,NULL,'The child sections to be added to the `jumbotron` body. This can hold any style.',0,0),(4,23,NULL,'Allows to assign CSS classes to the root item of the style.',0,0