CREATE DEFINER=`root`@`localhost` FUNCTION `get_pages`(p_parent INT) RETURNS json
    DETERMINISTIC
BEGIN
    DECLARE children_json JSON;

    SELECT 
      COALESCE(
        JSON_ARRAYAGG(
          JSON_OBJECT(
            'id',                    c.id,
            'keyword',               c.keyword,
            'url',                   c.url,
            'protocol',              c.protocol,
            'id_actions',            c.id_actions,
            'id_navigation_section', c.id_navigation_section,
            'parent',                c.parent,
            'is_headless',           c.is_headless,
            'nav_position',          c.nav_position,
            'footer_position',       c.footer_position,
            'id_type',               c.id_type,
            'id_pageAccessTypes',    c.id_pageAccessTypes,
            'is_open_access',        c.is_open_access,
            'is_system',             c.is_system,
            'children',              get_pages_json(c.id)
          )
        ),
        JSON_ARRAY()
      )
    INTO children_json
    FROM pages AS c
    WHERE 
      (
        p_parent IS NULL  AND c.parent IS NULL
      )
      OR
      (
        p_parent IS NOT NULL AND c.parent = p_parent
      );

    RETURN children_json;
END ;;
